			molesWaterPerMolH2SO43 = (densidadH2O * aguadil3 / 18.08) / (densidadH2SO4 * sulfur1 / 98.08);
		
			if (molesWaterPerMolH2SO43 <= 4) {
				entalpia3 = ((-54.7 / 4) * molesWaterPerMolH2SO43) - entalpia2;
		
			} else if (molesWaterPerMolH2SO43 > 4 && molesWaterPerMolH2SO43 <= 20) {
				entalpia3 = (-54.7 + ((-13.0 / 6) * (molesWaterPerMolH2SO43 - 4))) - entalpia2;
		
			} else {
				entalpia3 = -67.7 - entalpia2 + 1;
			}
			masaH2SO43 = densidadH2SO4 * sulfur1;
			masaH2O3 = densidadH2O * aguadil3;
			masaTotal3 = masaH2SO43 + masaH2O3;
			masaTotal3 = masaTotal3.toFixed(3);
			id = document.getElementById("masa_txt");
			id.innerHTML = masaTotal3;
			fraccionH2SO43 = masaH2SO43 / masaTotal3;
			fraccionH2O3 = masaH2O3 / masaTotal3;
			cpMezcla3 = fraccionH2SO43 * cpH2SO4 + fraccionH2O3 * cpH2O;
			cpMezcla3 = cpMezcla3.toFixed(3);
			id = document.getElementById("cp_txt");
			id.innerHTML = cpMezcla3;
			calor3 = -entalpia3 * 1000 * (densidadH2SO4 * sulfur1 / 98.08);
			kt3 = kc + masaTotal3 * cpMezcla3;
			aumentot3 = calor3 / kt3;
